import React, { Component } from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import { Container, Row, Col } from "react-bootstrap";
import Button from 'react-bootstrap/Button';
import { FaUserCircle } from "react-icons/fa";
import {Navbar, Nav, Form, FormControl} from 'react-bootstrap';
import "./App.css";

class App extends Component {
  render() {
    return (
      <div className="App">
        <Navbar bg="dark" variant="dark">
    <Navbar.Brand href="phone.png">Navbar</Navbar.Brand>
    <Nav className="mr-auto">
      <Nav.Link href="#home">Home</Nav.Link>
      <Nav.Link href="#features">Features</Nav.Link>
      <Nav.Link href="#pricing">Pricing</Nav.Link>
    </Nav>
    <Form inline>
      <FormControl type="text" placeholder="Search" className="mr-sm-2" />
      <Button variant="outline-info">Search</Button>
    </Form>
  </Navbar>
        <Container fluid className="cont">
          <Row>
            <Col sm={8}>
			<FaUserCircle color="dodgerblue" size={80} className="icon"/>
              <input type="text" placeholder="Enter First Name"></input>
              <input type="text" placeholder="Enter Last Name"></input>
              <input type="email" placeholder="Enter Email"></input>
              <input type="text" placeholder="Enter Your Number"></input>
              <Button variant="success" className="but">SUBMIT</Button>
            </Col>
          </Row>
        </Container>
      </div>
    );
  }
}

export default App;
